import React, { useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PricingPage from './components/PricingPage';
import ErrorPage from './components/ErrorPage';

function LandingPage() {
  useEffect(() => {
    // Load Tally form embeds when component mounts
    if (window.Tally) {
      window.Tally.loadEmbeds();
    }

    // Setup form submission tracking
    const handleTallySubmit = () => {
      if (window.gtag) {
        window.gtag('event', 'form_submission', {
          'event_category': 'engagement',
          'event_label': 'signup_form'
        });
        window.gtag_report_conversion();
      }
    };

    // Listen for Tally form submission
    window.addEventListener('tally-form:submit', handleTallySubmit);

    return () => {
      window.removeEventListener('tally-form:submit', handleTallySubmit);
    };
  }, []);

  return (
    <div className="bg-white">
      <header className="absolute inset-x-0 top-0 z-50">
        <nav className="flex items-center justify-center p-6 lg:px-8" aria-label="Global">
          <div className="flex">
            <a href="/" className="-m-1.5 p-1.5">
              <span className="text-2xl font-bold text-black">üè• Medical Provider Leads</span>
            </a>
          </div>
        </nav>
      </header>

      <div className="relative isolate pt-14">
        <div className="absolute inset-x-0 -top-40 -z-10 transform-gpu overflow-hidden blur-3xl sm:-top-80">
          <div
            className="relative left-[calc(50%-11rem)] aspect-[1155/678] w-[36.125rem] -translate-x-1/2 rotate-[30deg] bg-gradient-to-tr from-primary-200 to-primary-400 opacity-30 sm:left-[calc(50%-30rem)] sm:w-[72.1875rem]"
            style={{
              clipPath:
                'polygon(74.1% 44.1%, 100% 61.6%, 97.5% 26.9%, 85.5% 0.1%, 80.7% 2%, 72.5% 32.5%, 60.2% 62.4%, 52.4% 68.1%, 47.5% 58.3%, 45.2% 34.5%, 27.5% 76.7%, 0.1% 64.9%, 17.9% 100%, 27.6% 76.8%, 76.1% 97.7%, 74.1% 44.1%)',
            }}
          />
        </div>

        <div className="mx-auto max-w-7xl px-6 py-24 sm:py-32 lg:px-8">
          <div className="mx-auto max-w-2xl text-center">
            <h1 className="text-4xl font-bold tracking-tight text-gray-900 sm:text-6xl">
              Access the Largest Database of Healthcare Providers
            </h1>
            <p className="mt-6 text-lg leading-8 text-gray-600">
              Get instant access to verified contact information for healthcare providers across the United States. Perfect for medical device sales, pharmaceutical companies, and healthcare recruiters.
            </p>
          </div>

          <div className="mx-auto mt-16 max-w-xl sm:mt-20">
            <iframe
              data-tally-src="https://tally.so/embed/w7EY0R?alignLeft=1&hideTitle=1&transparentBackground=1&dynamicHeight=1"
              loading="lazy"
              width="100%"
              height="364"
              frameBorder="0"
              marginHeight="0"
              marginWidth="0"
              title="MedicalProviderLeads"
              style={{ maxWidth: '100%', margin: '0 auto' }}
            ></iframe>
            <p className="mt-4 text-sm text-gray-500 text-center">
              Your card will not be charged until your 30-day trial has ended, and you can cancel + export your data any time before that.
            </p>
          </div>

          <div className="mt-16 text-center">
            <h2 className="text-3xl font-bold tracking-tight text-gray-900">
              Trusted by Leading Healthcare Companies
            </h2>
            <div className="mt-10 grid grid-cols-4 items-center gap-x-8 gap-y-10 sm:grid-cols-6 sm:gap-x-10 lg:grid-cols-4">
              {/* Add your client logos here */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/pricing" element={<PricingPage />} />
        <Route path="/error" element={<ErrorPage />} />
      </Routes>
    </Router>
  );
}
